int32_t templates_count(void) { return sizeof(templates) / sizeof(struct template); }
const struct template *templates_get(void) { return templates; }
void templates_get_data(const char **data, size_t *data_len, size_t *data_olen) { *data = templates_data; *data_len = templates_data_len; *data_olen = templates_data_olen; }

bool template_is_image(enum template_types tpl_type) {
	switch (tpl_type) {
	case TEMPLATE_TYPE_PNG:
	case TEMPLATE_TYPE_GIF:
	case TEMPLATE_TYPE_ICO:
	case TEMPLATE_TYPE_JPG:
		return true;
	default:
		return false;
	}
	return false;
}

const char *template_get_mimetype(enum template_types tpl_type) {
	switch (tpl_type) {
	case TEMPLATE_TYPE_TEXT: return "text/plain";
	case TEMPLATE_TYPE_PNG : return "image/png";
	case TEMPLATE_TYPE_GIF : return "image/gif";
	case TEMPLATE_TYPE_ICO : return "image/x-icon";
	case TEMPLATE_TYPE_JPG : return "image/jpg";
	}
	return "";
}

